import { getImageUrl } from './utils.js';

const Avatar = (props) => {
 let person = props.person;
 let size = props.size;


  return (
    <img
      className="avatar"
      src={getImageUrl(person)}
      alt={person.name}
      width={size}
      height={size}
    />
  );
}

export default Avatar;
